import React from 'react';
import './YourOrder.css';

interface IOrder {
	// id: number;
	closeButton: Function;
}

const YourOrder: React.FC<IOrder> = (props: IOrder) => {
	return (
		<div id="your-order">
			<span
				id="closeOrder"
				onClick={() => props.closeButton()}
				className="close-order">
				x
			</span>
			<div id="order-card">
				<div id="title-order">YOUR ORDER</div>
				<div id="rest-order-name">Mashya</div>
				<div className="bag">
					<div id="order-information"></div>
					<div id="comment-and-buttons-container">
						<div id="add-comment">Add A Comment</div>
						<input
							placeholder="Special requests, allergies, detary restrictions, etc."
							type={'text'}
							id="comment-input"
						/>
						<button
							id="check-out"
							type="submit">
							Checkout 264
						</button>
						<button
							type="submit"
							id="history-order">
							Order history
						</button>
					</div>
				</div>
			</div>
		</div>
	);
};

export default YourOrder;
